export default {
	items: Get_Tenants.data,
	selectedItem : {},
	getItems: async () => {
		//use async-await or promises
		if(!Get_Tenants.data) {
			await Get_Tenants.run();
		}
		this.items = Get_Tenants.data;
		return this.items;
	},
	options : () => {
		let options = [];
		if(this.items) {
			this.items.forEach(function(item){
				options.push({
					label : item.pp_name,
					value : item.pp_tenantid
				});
			});
		}
		return options;
	}
}
